import classes from "./CustomersList.module.css";

const CustomersList = (props) => {
  return (
    <ul className={classes.list}>
      {props.db.map((person) => {
        <Customer
          name={person.name}
          vat={person.vat}
          address={person.address}
          date={person.date}
        />;
      })}
    </ul>
  );
};

export default CustomersList;
